import { motion } from 'framer-motion';

const Portfolio = () => {
  const poetryProjects = [
    {
      title: "Soupy Writes",
      description: "A collection of original poetry exploring themes of love, life, and human experience.",
      platform: "Instagram",
      link: "https://www.instagram.com/soupy_writes/",
      featured: true
    }
  ];

  const creativeWorks = [
    {
      title: "Poetry Series",
      description: "Regular poetry updates sharing personal stories and observations through verse.",
      platform: "Instagram"
    },
    {
      title: "Audio Poetry",
      description: "Spoken word recordings bringing poetry to life through voice and emotion.",
      platform: "Instagram"
    }
  ];

  const poems = [
    {
      title: "The Dance of Time",
      content: "In the quiet moments, time whispers,\nA symphony of seconds,\nEach tick a note in the grand ballet,\nOf life's eternal melody.\n\nMoments pirouette in grace,\nWhile shadows waltz with light,\nIn this dance of time, we find,\nOur fleeting moments bright."
    },
    {
      title: "Whispers of the Wind",
      content: "The breeze carries secrets,\nWhispering through the leaves,\nA symphony of silence,\nIn the rustling trees.\n\nIt speaks of distant lands,\nAnd stories yet untold,\nEach gust a gentle reminder,\nOf the beauty of the cold."
    },
    {
      title: "Echoes of the Soul",
      content: "In the depths of quiet thoughts,\nEchoes of the heart resound,\nEach beat a melody,\nOf life's profound.\n\nSilent whispers,\nOf dreams and fears,\nIn the stillness,\nOur truest selves appear."
    }
  ];

  return (
    <div className="page-content">
      <motion.div
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5 }}
        className="container mx-auto px-4 py-16"
      >
        <motion.h1
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          className="text-4xl font-bold mb-8"
        >
          Creative Portfolio
        </motion.h1>

        <div className="space-y-12">
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5 }}
            className="bg-white/5 backdrop-blur-sm p-8 rounded-lg shadow-lg"
          >
            <h2 className="text-2xl font-bold mb-4">Instagram Poetry Feed</h2>
            <p className="text-gray-300 mb-8">My poetry collection from Instagram (@soupy_writes)</p>

            {loading ? (
              <div className="flex justify-center items-center min-h-[300px]">
                <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-400"></div>
              </div>
            ) : instagramFeed ? (
              <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
                {instagramFeed.map((post) => (
                  <motion.div
                    key={post.id}
                    initial={{ opacity: 0, y: 20 }}
                    animate={{ opacity: 1, y: 0 }}
                    transition={{ duration: 0.5 }}
                    className="bg-white/10 backdrop-blur-sm rounded-lg overflow-hidden"
                  >
                    {post.media_type === 'IMAGE' ? (
                      <img
                        src={post.media_url}
                        alt={post.caption}
                        className="w-full h-64 object-cover"
                      />
                    ) : (
                      <video
                        src={post.media_url}
                        className="w-full h-64 object-cover"
                        controls
                      />
                    )}
                    <div className="p-4 bg-white/10">
                      <p className="text-gray-300 whitespace-pre-line">{post.caption}</p>
                      <div className="mt-2 text-sm text-gray-400">
                        <span className="font-medium">{new Date(post.timestamp).toLocaleDateString()}</span>
                      </div>
                    </div>
                  </motion.div>
                ))}
              </div>
            ) : (
              <div className="text-center text-red-400">
                <p>Failed to load Instagram feed. Please try again later.</p>
              </div>
            )}
          </motion.div>

          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5, delay: 0.2 }}
            className="bg-white/5 backdrop-blur-sm p-8 rounded-lg shadow-lg"
          >
            <h2 className="text-2xl font-bold mb-4">More Creative Works</h2>
            <p className="text-gray-300 mb-8">Explore more of my creative endeavors:</p>

            <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
              <motion.div
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.5, delay: 0.3 }}
                className="bg-white/10 backdrop-blur-sm p-6 rounded-lg hover:shadow-lg transition-shadow"
              >
                <h3 className="text-xl font-semibold mb-4">Photography</h3>
                <p className="text-gray-300">Capturing moments through the lens.</p>
              </motion.div>
              <motion.div
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.5, delay: 0.4 }}
                className="bg-white/10 backdrop-blur-sm p-6 rounded-lg hover:shadow-lg transition-shadow"
              >
                <h3 className="text-xl font-semibold mb-4">Design</h3>
                <p className="text-gray-300">Creating beautiful and functional digital experiences.</p>
              </motion.div>
            </div>
          </motion.div>
        </div>
      </motion.div>
    </div>
  );
};

export default Portfolio;
